            <label for = "email"> email</label>
            <input value={email}  onChange={(e)=> setEmail(e.target.value)}   type="email" placeholder="your email" id="email"  name ="email"/>
            <label for = "password">password </label>
            <input value = {pass} onChange={(e)=> setPassword(e.target.value)}  type="password" placeholder="your password" id="password"  name ="password"/>
            <button type="submit">Login</button>

        </form>


    )
}
